import React from "react";
import { useState } from "react";
const [song, setSong] = useState('Please enter Song title...')

function SearchBar () {
  return (
    <div className="searchBar">
      <input type="text" placeholder={song}></input>
      <input type="submit" className="buttonSubmit" value={'SEARCH'}></input>
    </div>
  )
}

export default SearchBar;
